@toyist_zone Great gift for a child?

What for?  So the child can choke on it?

This is exactly why I ignore every ad that scrolls across my social media feeds.  You have got no idea who these merchants are.  And if you seek a refund, then you might have to ship your return to China.

@lordstern1 Mr. Stern, 
Greetings from China! 

This is Bridging News, a channel that focuses on Asian business and politics. We are deeply impressed with your insights on the topics listed in your Twitter profile, and we are wondering if we have the honor to interview you on these topics.
